import React, { Props } from 'react'
import { createDrawerNavigator, DrawerContentScrollView, DrawerItemList, DrawerItem } from '@react-navigation/drawer'
import { useNavigation, NavigationContainer } from '@react-navigation/native'
import Login from '../../pages/Login'
import { createStackNavigator } from '@react-navigation/stack'
import { StackNavigationConfig, StackNavigationOptions } from '@react-navigation/stack/lib/typescript/src/types'
import Home from '../../pages/Home'
import { Alert } from 'react-native'

const CustoDrawerContent = (props: any) => {
    return (
        <DrawerContentScrollView {...props}>
            <DrawerItemList {...props} />
            <DrawerItem label="Help" onPress={() => Alert.alert('Link')} />
        </DrawerContentScrollView>
    )
}

const MyDrawer = () => {

    const Drawer = createDrawerNavigator()

    return (
        <Drawer.Navigator drawerContent={props => <CustoDrawerContent {...props} />}>
            <Drawer.Screen name="Home" component={Home}  />
            <Drawer.Screen name="Login" component={Login} />
        </Drawer.Navigator>

    )
}


export default MyDrawer
